import React from 'react';
import '../App.css';
import { Route, Switch } from 'react-router-dom';
import Header from './Header';
import PageTitle from './PageTitle';
import './styles.css';

const Home = () => (
  <>
  <Header />
    <h1 class="pageTitle">Home</h1>
    <PageTitle title="Home"></PageTitle>
  </>
)

export default Home;
